import React from "react";
import { getMovies } from "../movie_data";
import { Link } from "react-router-dom";

const Movies = () => {
  const movies = getMovies();
  return (
    <div>
      <h1>넷플릭스 영화 추천 목록</h1>
      <div>
        {movies.map((movie) => (
          <Link to={`/movies/${movie.id}`} key={movie.id}>
            {movie.title}
          </Link>
        ))}
      </div>
    </div>
  );
};

export default Movies;
